    static _getTypeColor(type) {
        const darkmode = CONFIG.worldofdarkness.darkmode; //game.settings.get('worldofdarkness', 'darkMode');
        let color = "rgb(24, 78, 119)";

        type = type.toLowerCase().replace(" ", "");

        switch (type) {
            case "black":
                color = "rgb(0,0,0)"
                break;
            case "mortal":
                color = "rgb(24, 78, 119)";
                break;
            case "werewolf":
                color = "rgb(88, 49, 1)";
                break;
            case "changingbreed":
                color = "rgb(88, 49, 1)";
                break;
            case "mage":
                color = "rgb(83, 33, 89)";
                break;
            case "vampire":
                color = "rgb(121, 8, 19)";
                break;
            case "changeling":
                color = "rgb(42, 92, 165)";
                break;
            case "hunter":
                color = "rgb(191, 67, 18)";
                break;
            case "demon":
                color = "rgb(229, 111, 8)";
                break;
            case "wraith":
                color = "rgb(93, 196, 158)";
                break;
            case "mummy":
                color = "rgb(175, 153, 8)";
                break;
            case "exalted":
                color = "rgb(169,44,38)";
                break;
            case "creature":
                color = "rgb(116, 115, 115)";
                break;
        }

        return color;
    }

